import React, { useState, useEffect } from 'react';

const Packages = () => {
    const [packaged, setPackages] = useState([]);

    useEffect(() => {
        fetch(`http://localhost:3020/api/packages/`)
            .then(respose => respose.json())
            .then(data => {
                setPackages(data.map(id => (
                    <div key={id} className="col-sm-5 col-md-4 col-lg-3">
                       
                    </div>
                )));
            });
    }, []);
    return (<div>{packaged}</div>)
}
export default Packages;
